import { Button, Typography } from '@mui/material';
import '../../App.css';
import Header from '../utils/Header';
import config from '../../config';

function LandingPage() {
  return (
    <div style={{ width: '100%' }}>
      <Header />
      <div style={{ width: '100%', paddingTop: 45 }}>
        <div style={{ top: 100, marginLeft: 50, position: 'fixed' }}>
          <Typography component='h5' variant='h1' style={{ width: '100%', fontFamily: 'Markazi' }}>Des solutions personnalisées</Typography>
          <Typography component='h5' variant='h2' style={{  width: '100%', fontFamily: 'Markazi' }}>pour alléger vos mensualités</Typography>
        </div>
        <div style={{ display: 'flex', flexDirection: 'row', width: '100%' }}>
          <div style={{ width: '50%', marginRight: 25, display: 'flex', justifyContent: 'flex-end', alignItems: 'flex-end' }}>
            <div style={{ width: '40%', display: 'flex', flexDirection: 'column', justifyContent: 'center' }}>
              <img style={{ width: '100%', height: 'auto' }} alt="simplifiez vos finances" src={require('../../pictures/icon_rachat_credits.png')} />
              <Button color='basic' variant="contained" style={{ fontFamily: 'Newsreader', display: 'flex', justifyContent: 'center', alignItems: 'center', marginLeft: 20 }}>Contactez-nous !</Button>
            </div>
            <Typography style={{ width: '60%', color: config.colors.dark, fontWeight: 'lighter', fontFamily: 'Newsreader', textAlign: 'center' }}>Le rachat de crédits est bien plus qu'une simple démarche financière : c'est une opportunité pour reprendre le contrôle de vos finances et retrouver une sérénité au quotidien. Imaginez réduire vos mensualités, regrouper tous vos prêts en un seul, et alléger votre budget tout en optimisant vos conditions de remboursement. Que vous souhaitiez faire face à des imprévus, financer de nouveaux projets, ou tout simplement vivre plus confortablement, le rachat de crédits est la solution idéale. Faites appel à mes services pour un accompagnement personnalisé et des résultats concrets. Ensemble, construisons une solution sur mesure adaptée à vos besoins !</Typography>
          </div>
          <div style={{ width: '50%' }}>
            <img style={{ width: '100%', height: 'auto' }} alt="simplifiez vos finances" src={require('../../pictures/landingPagePeople.png')} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default LandingPage;
